import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // Подключение стилей, если они есть
import App from './App'; // Проверьте, что путь к вашему компоненту App указан правильно
import reportWebVitals from './reportWebVitals';

ReactDOM.render(

  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// Если у вас есть отчет о производительности, подключите его
reportWebVitals();
